<template>
	<view class="box" :style="{width:width ,height:height}">
		<view style="height: 60px;"></view>
		<view class="logo">
			<image src="../../static/logo.png" mode="aspectFill" style="height: 120px;width: 120px;margin-top: 20px;"></image>
			<text style="color: #007AFF;margin-top: 10px;">文明城市创建系统</text>
			<text style="color: #007AFF;font-size: 12pt;">实时 高效 动态</text>
		</view>
		<view class="login">
			<view class="form_group">
				<label>账号:</label>
				<input class="uni-input" type="number" maxlength="11" style="height:15px; font-size:15px;" v-model="user" placeholder="请输入你的手机号" />
			</view>
			<view class="form_group">
				<label>密码:</label>
				<input class="uni-input" style="height:15px; font-size:15px;" password v-model="passwd" placeholder="请输入密码" />
			</view>
			<view class="resetpw">
				<text @click="resetpw">忘记密码</text>
			</view>
			<view class="form_login">
				<button type="primary" @click="login">登录</button>
			</view>
		</view>
	</view>
</template>

<script>
	var _self;
	import {checkPhone,checkPwd,toast} from "@/common/common.js"
	export default {
		data() {
			return {
				user:'',
				passwd:'',
				width:'100%',
				height:800+'px'
			}
		},
		methods: {
			login(){
				let user=_self.user;
				let pw=_self.passwd;
				if(!checkPhone(user)){
					return;
				}
				if(!checkPwd(pw)){
					return;
				}
				if(user=="12345678901" && pw=="123456"){
					uni.reLaunch({
						url:"../index/index"
					})
					try {
						uni.setStorageSync('user', user);
					} catch (e) {
						// error
					}
				}else{
					toast('用户名或密码错误!');
				}
			},
			resetpw(){
				uni.navigateTo({
					url:"../ucenter/register"
				})
			}
		},
		onLoad() {
			_self=this;
		},
		onShow() {
			const res = uni.getSystemInfoSync();
			this.height=res.windowHeight+'px';
			try {
				const value = uni.getStorageSync('user');
				if (value!='') {
					toast(value+'已登录');
					uni.reLaunch({
						url:"../index/index"
					})
				}
			} catch (e) {
				// error
			}
		},
		onResize(){
			const res = uni.getSystemInfoSync();
			uni.pageScrollTo({
				scrollTop: res.screenHeight-300,
				duration:100
			});
		}
	}
</script>

